class LRUCache {
	int capacity;
	HashMap<Integer,DLLNode> map;
	LRUQueue queue;
	
    public LRUCache(int capacity) {
    	this.capacity = capacity;
		this.map = new HashMap<>();
		this.queue = new LRUQueue();
    }
    
    public int get(int key) {
        if(this.map.containsKey(key))
        	return this.map.get(key).val;
        else
        	return -1;
    }
    
    public void set(int key, int value) {
    	System.out.println("set("+key+","+value+")");
    	System.out.println("Queue top: "+ this.queue.top +"  battom: "+ this.queue.bottom);
    	if(this.map.containsKey(key)){
    		//System.out.println(map);
    		DLLNode temp = this.map.get(key);
    		this.queue.set(temp,value);
    		
    	}
    	else{
    		if(map.size()<capacity){
    			DLLNode node = new DLLNode(value);
    			this.map.put(key, node);
    			this.queue.add(node);
    		}
    		else{
    			DLLNode node = new DLLNode(value);
    			DLLNode delNode = this.queue.delAndInsert(node);
    			int index = getDelNodeIndex(delNode);
    			this.map.remove(index);
    			this.map.put(key, node);
    		}
    	}
    	
    }
    
    public int getDelNodeIndex(DLLNode delNode){
    	Iterator<Integer> itr = this.map.keySet().iterator();
    	int key = -1;
    	while(itr.hasNext()){
    		key = itr.next();
    		if(this.map.get(key) == delNode){
    			break;
    		}
    	}
    	return key;
    	
    }
    
    public String toString(){
    	return this.map.toString();
    }
}

class LRUQueue {
	DLLNode top;
	DLLNode bottom;
	
	public LRUQueue(){
		this.top = null;
		this.bottom = null;
	}
	
	public void set(DLLNode node, int value){
		DLLNode temp = this.top;
		while(temp.val != node.val){
			temp = temp.next;
			if(temp == null){
				System.out.println("fuck");
			}
		}
			
		if(top == temp){
			temp.val = value;
			return;
		}
		if(bottom == temp){
			bottom = temp.prev;
		}
		DLLNode prevNode = temp.prev;
		prevNode.next = temp.next;
		if(temp.next != null){
		    prevNode.next.prev = prevNode;    
		}
		temp.val = value;
		temp.next = top;
		top.prev = temp;
		top = temp;
	}
	
	public void add(DLLNode node){
		if(node.val == 5){
			System.out.println();
		}
		if(top == null){
			top = node;
			bottom = node;
		}
		else{
			node.next = top;
			top.prev = node;
			top = node;
		}
	}
	
	public DLLNode delAndInsert(DLLNode node){
		node.next = top;
		top.prev = node;
		top = node;
		DLLNode delNode = bottom;
		bottom.prev.next = null;
		bottom = bottom.prev;
		delNode.prev = null;
		return delNode;
	}
}

class DLLNode {
	int val;
	DLLNode next;
	DLLNode prev;
	
	public DLLNode(int val){
		this.val = val;
	}
	
	public String toString(){
		return Integer.toString(this.val);
	}
	
}
